import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('ssi-include', () => {
    test('ok', async () => {
        const r1 = await request('http://ssi-include.whistlejs.com/index.html?doNotParseJson');
        expect(r1.data).toContain('include1.html');
        expect(r1.data).toContain('include2.html');
        expect(r1.data).toContain('include3.html');
    });
});
